import "./Profile.css";

function Profile (){
    return(
        <div className="main-container">
            <div className="profile-left-container">
                <h1>Left</h1>
            </div>
            <div className="profile-center-container">
                <h1>Center</h1>
            </div>
            <div className="profile-right-container">
                <h1>Right</h1>
            </div>
        </div>
    )
}

export default Profile;
